import './about.scss';
import SelfPortrait from '../../assets/SelfPortrait.jpg';

function About() {
  return (
    <div className="About">
      <h1><it>A Special Hello</it></h1>


      <div className="Portrait">
        <div className="PortraitImage">
          <img src={SelfPortrait} alt="Self Portrait" draggable="false"/>
        </div>
      </div>




    </div>
  )
}

export default About
